import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate, useLocation } from 'react-router-dom';
import { AuthProvider, useAuth } from './context/AuthContext';
import { DeliveryProvider } from './context/DeliveryContext';
import Login from './components/auth/Login';
import DeliveryFlow from './pages/DeliveryFlow';
import AdminPanel from './components/admin/AdminPanel';
import './styles/globals.css';

// Î©îÏù∏ Ïï± Ïª®ÌÖêÏ∏† Ïª¥Ìè¨ÎÑåÌä∏
const AppContent = () => {
  const { isAuthenticated, login, logout, user } = useAuth();
  const location = useLocation();
  const [currentView, setCurrentView] = useState('login'); // 'login', 'delivery', 'admin'

  const handleLogin = async (credentials) => {
    try {
      await login(credentials);
      console.log('Î°úÍ∑∏Ïù∏ ÏÑ±Í≥µ!');
      setCurrentView('delivery');
    } catch (error) {
      console.error('Login failed:', error);
      throw error; // Login Ïª¥Ìè¨ÎÑåÌä∏ÏóêÏÑú ÏóêÎü¨ Ï≤òÎ¶¨Ìï† Ïàò ÏûàÎèÑÎ°ù
    }
  };

  const handleLogout = () => {
    logout();
    setCurrentView('login');
  };

  const handleNavigateToRegister = () => {
    console.log('Navigate to register');
    // ÌöåÏõêÍ∞ÄÏûÖ ÌéòÏù¥ÏßÄÎ°ú Ïù¥Îèô Î°úÏßÅ
  };

  const handleNavigateToIdRequest = () => {
    console.log('Navigate to ID request');
    // ÏïÑÏù¥Îîî Î∞úÍ∏â ÌéòÏù¥ÏßÄÎ°ú Ïù¥Îèô Î°úÏßÅ
  };

  const handleNavigateToAdmin = () => {
    setCurrentView('admin');
  };

  const handleBackToDelivery = () => {
    setCurrentView('delivery');
  };

  // URL Í∏∞Î∞ò ÎùºÏö∞ÌåÖ Ï≤òÎ¶¨
  React.useEffect(() => {
    if (location.pathname === '/admin') {
      setCurrentView('admin');
    } else if (location.pathname === '/' && isAuthenticated) {
      setCurrentView('delivery');
    } else if (!isAuthenticated) {
      setCurrentView('login');
    }
  }, [location.pathname, isAuthenticated]);

  // ÌòÑÏû¨ Î∑∞Ïóê Îî∞Î•∏ Î†åÎçîÎßÅ
  const renderCurrentView = () => {
    if (!isAuthenticated && currentView !== 'admin') {
      return (
        <Login 
          onLogin={handleLogin}
          onNavigateToRegister={handleNavigateToRegister}
          onNavigateToIdRequest={handleNavigateToIdRequest}
        />
      );
    }

    switch (currentView) {
      case 'admin':
        return (
          <div>
            <AdminPanel />
            {isAuthenticated && (
              <button
                onClick={handleBackToDelivery}
                className="fixed top-4 left-4 z-50 bg-blue-500 text-white px-3 py-2 rounded-lg text-sm hover:bg-blue-600 transition-colors"
                title="Î∞∞ÏÜ° ÌéòÏù¥ÏßÄÎ°ú ÎèåÏïÑÍ∞ÄÍ∏∞"
              >
                ‚Üê Î∞∞ÏÜ°
              </button>
            )}
          </div>
        );

      case 'delivery':
        return (
          <div>
            <DeliveryFlow />

            {/* Í¥ÄÎ¶¨Ïûê ÌéòÏù¥ÏßÄ Ï†ëÍ∑º Î≤ÑÌäº */}
            <div className="fixed bottom-4 right-4 flex flex-col gap-2">
              <button
                onClick={handleNavigateToAdmin}
                className="bg-red-500 text-white px-3 py-2 rounded-full text-sm hover:bg-red-600 transition-colors shadow-lg"
                title="Í¥ÄÎ¶¨Ïûê ÌéòÏù¥ÏßÄ"
              >
                üë®‚Äçüíº Admin
              </button>
              <button
                onClick={handleLogout}
                className="bg-gray-500 text-white px-3 py-2 rounded-full text-sm hover:bg-gray-600 transition-colors shadow-lg"
                title="Î°úÍ∑∏ÏïÑÏõÉ"
              >
                üö™ Logout
              </button>
            </div>
          </div>
        );

      default:
        return (
          <Login 
            onLogin={handleLogin}
            onNavigateToRegister={handleNavigateToRegister}
            onNavigateToIdRequest={handleNavigateToIdRequest}
          />
        );
    }
  };

  return renderCurrentView();
};

// ÎùºÏö∞ÌÑ∞ Í∏∞Î∞ò Ïï± Ïª¥Ìè¨ÎÑåÌä∏
const RouterApp = () => {
  return (
    <Router>
      <AuthProvider>
        <DeliveryProvider>
          <div className="App">
            <Routes>
              {/* Í∏∞Î≥∏ ÌéòÏù¥ÏßÄ */}
              <Route path="/" element={<AppContent />} />

              {/* Í¥ÄÎ¶¨Ïûê ÌéòÏù¥ÏßÄ */}
              <Route path="/admin" element={<AppContent />} />

              {/* Í∏∞ÌÉÄ ÎùºÏö∞Ìä∏Îì§ */}
              <Route path="/delivery" element={<AppContent />} />

              {/* 404 ÌéòÏù¥ÏßÄ */}
              <Route path="*" element={<Navigate to="/" replace />} />
            </Routes>
          </div>
        </DeliveryProvider>
      </AuthProvider>
    </Router>
  );
};

// Î©îÏù∏ App Ïª¥Ìè¨ÎÑåÌä∏
function App() {
  return <RouterApp />;
}

export default App;
